	{
		$.data(root, 'ThemeSelect', this);
		var self = this;
		this.root = $(root);
		this.options = opts;
		
		this.root.next().find('.dx-theme-link').click(function()
		{
			self.changeTheme($(this).data('themeId'));
		});
	};
	
